あとチョコレートいちごパイ✌️

@M18118417 ソレ、娘もやってるんですよ❗️
腰位まで伸びてるんですよ💇‍♀️
切ってもまた綺麗な髪色が見てみたいです😍

@M18118417 ガッツリグレーな白髪ならアリですね✌️
それを意識して銀髪だったりアッシュグレーにしてまして🤤
んで時々失敗してラベンダー色になってしまうと言う（笑）

