ただ40を迎えるにあたり、今の
髪型＆髪色を続けても良いのか変えるべきか日々悩んでいます😂

@M18118417 おめでとうございます🎊
僕なんか今年いよいよ40ですょ🥲
歳はとりたくないです・・・

@gbird94999199 なんと素敵な😍
大好物の円形ベッド🪐
イキたいけど我慢我慢💦

@carrot_lapaix 最後はオッサン辞めてしまいました😭

ダブルワークでしたしお金を掛けてまで対策を講じる事は出来ないとの理由で💡

ラブホも楽な仕事ではありませんね💦

@puoxop_ そうなんですか！
チョット検索してみます👀
ウチも大っぴらには話はしてませんが、夫婦のラブホ探訪の事は知ってますし、本人に興味があれば、2年後に連れてっても良いかもしれませんね♪

@puoxop_ あっソレです！
娘はそこにあった「しぬたがーる」のTシャツが欲しいみたいで（笑）
オジサンには全くわかりませんでした💦

@yoshimin_0324 @YouTube 編集アプリをいくつか組み合わせて何とか作ってます💦
なのでたかだか10分位の動画でも丸々3日とか掛かってしまうんです😭
ではあのURLのチャンネル登録しときます✌️

@motel_mania おはようございます♪
「実家感」「おばあちゃん家感」はレトロならではの味わいですね♪
妻とは唯一、それを味わいに行くか否かで意見が合わないんです（笑）

@carrot_lapaix セットを持って来てくれたら仕上げるので安くしてって思います（笑）
慣れるまでは大変でしょうが無理のない程度に頑張って下さい👍
あと少しで遅番と交代の時間ですね🏩

@carrot_lapaix お疲れ様です！
今日は土曜日で雨なのでお客さんも多いんじゃないですか？
何だか僕も久々にベッドメイクしたくなりました（笑）

@carrot_lapaix 女性で風呂専は大変だったでしょう💦

でも懐かしいお話が出来て嬉しいです♪

カゴとかセットとか懐かしい😭

@carrot_lapaix 嫌がらせですか💦
何かよっぽどの事があったんですかね⁉️
こちらの地域では待ちが多い時とかに男性が風呂とトイレだけを先に掃除して周る事を「風呂専」って言ってました🛁

@gbird94999199 やってもらうのは大歓迎なんですが（笑）
しかもエスパー伊藤みたいなフェラを当ててしまいました😂
ムリィ〜

@tontontonko3 僕も同じ事を思いました（笑）
せめて見切れないかなぁって😂
でも秘宝館は微かに見切れてましたね👍

@khadiga_em 僕も同じ事を思ってました💦

ただでさえ県内ではネタ切れに近かったのに・・・

でも仕方ないですね😭
